import React from 'react';
import { Table, Space, Button } from 'antd';
import { Link } from 'react-router-dom';
import moment from 'moment';
const ExamList = () => {
	const type = 'teacher';
	const data = [
		{
			key: 1,
			sınav: 'cloud computing',
			startDate: '2021-02-08 11.30',
			endDate: '2021-02-08 12.30',
		},
		{
			key: 2,
			sınav: 'bulut bilişim',
			startDate: '2021-02-08 11.30',
			endDate: '2021-02-08 12.00',
		},
	];
	const columns = [
		{
			title: 'Exam',
			dataIndex: 'sınav',
		},
		{
			title: 'Start Date',
			dataIndex: 'startDate',
		},
		{
			title: 'End Date',
			dataIndex: 'endDate',
		},
		{
			title: 'Actions',
			key: 'actions',
			render: (record) =>
				type === 'teacher' ? (
					<Space>
						<Link to={'/delete-exam/'.concat(record.key)}>
							<a>delete</a>
						</Link>
					</Space>
				) : (
					<Space size='middle'>
						<Link
							to={(record) => {
								if (
									moment().isAfter(
										moment(record.startDate, 'YYYY-MM-DD HH:mm')
									) &&
									moment().isBefore(moment(record.endDate, 'YYYY-MM-DD HH:mm'))
								)
									'/exam/'.concat(record.key);
								else {
								}
							}}
						>
							<a>take exam</a>
						</Link>
					</Space>
				),
		},
	];
	return <Table dataSource={data} columns={columns} />;
};
export default ExamList;
